import React from "react";

export default function Movie() {
    return(
            <form className="form">
                <label htmlFor="query" className="label">Movie Name</label>
                <input 
                    className="input"
                    type="text" 
                    name="query"
                    placeholder="Search for a movie">
                </input>
                <button className="btn" type="submit">Search</button>
            </form>
    )
}
